import React from "react";

export default function About() {
  return (
    <div className="p-5">
      <h1 className="display-4 text-warning">About Contact Manager</h1>
      <p className="text-muted">
        Simple web application to help manage your contacts
      </p>
      <p className="text-secondary">Version 1.0.0</p>
    </div>
  );
}
